function(tileId){
var playerCoordinate = getCoordinateOfPlayer(game.getActivePlayerId()),
tileCoordinate = game.getNode(tileId).getAttribute('coordinate');

if(game.getNode(tileId).getChildrenIds().length > 0){
if(playerCoordinate === 0 && tileCoordinate > 7 && tileCoordinate < 14){
console.log('goodP1');
return true;
} else if(playerCoordinate === 1 && tileCoordinate > 1 && tileCoordinate < 8){
console.log('goodP2');
return true;
}
}
console.log('bad');
return false;
}

function(beanId,coordinate){
var params = {parentId: game.getTileIdOfCoordinate(coordinate)};
params[beanId] = {};
game.moveMoreNodes(params);
}

function(coordinate){
var targetTileId = game.getTileIdOfCoordinate(getCoordinateOfPlayer(game.getActivePlayerId())),
pieceIds = game.getAllPieceIdsOnTile(game.getTileIdOfCoordinate(coordinate)),
i, parameters={parentId:targetTileId};
for(i=0;i<pieceIds.length;i+=1){
parameters[pieceIds[i]] = {};
}
game.moveMoreNodes(parameters);
}

function(tileId){
var coordinate = game.getNode(tileId).getAttribute('coordinate');
console.log('spreading from:',coordinate);
coordinate = spreadBeansOfCoordinate(coordinate);
console.log('spreading ended at:',coordinate);
while(isCoordinateGrabbable(coordinate)){
grabBeansOfCoordinate(coordinate);
coordinate = previousCoordinate(coordinate);
}
console.log('grabbed until:',coordinate);
if(isPlayerWon()){
game.endGame(game.getActivePlayerId());
} else if(isGameOver()){
game.endGame();
}
game.endTurn();
}

function(coordinate){
var beans = game.getAllPieceIdsOnTile(game.getTileIdOfCoordinate(coordinate)),
startCoordinate = coordinate,
i;
for(i=0;i<beans.length;i+=1){
coordinate = nextCoordinate(coordinate);
if(coordinate === startCoordinate){
coordinate = nextCoordinate(coordinate);
}
putBeanOnCoordinate(beans[i],coordinate);
}
return coordinate;
}

function(coordinate){
